import React from 'react';
import Movie from './Movie';

const Movies = ({gifs, handleOnClick, clicked}) => {
  const MovieList = gifs.map(gif => {
    return(
      <Movie
        id={gif.id}
        imageUrl={gif.images.downsized_large.url}/>
    );
  })

  return(
    <div className="gif-list">
      { MovieList }
    </div>
  )
}

export default Movies;
